import "./App.css";

function App() {
  return (
    <main>
      <div className="element-container">
        <h1 className="hero-title">COLLIN TRUMPLER</h1>
        <section></section>
        <aside className="project-container"></aside>
      </div>
      <div className="hero-background"></div>
    </main>
  );
}

function About() {
  return (
    <>
      <img src="" />
    </>
  );
}

function Project() {
  return <div className="project"></div>;
}

export default App;
